import React, { Component } from 'react';

import Aux from '../hoc/Aux/Aux';
import classes from './Profile.module.css';
import Navbar from './Navbar';
import Header from './Header';
import { Waypoint } from 'react-waypoint';

class Profile extends Component {
    constructor(props) {
        super(props);
        this.state = {
            links: [
                {
                    target: 'section-home',
                    text: 'home',
                },
                {
                    target: 'section-about',
                    text: 'about',
                },
                {
                    target: 'section-resume',
                    text: 'resume',
                },
                {
                    target: 'section-projects',
                    text: 'projects',
                },
                {
                    target: 'section-contact',
                    text: 'contact',
                }
            ],
            navbarClass: classes.Navbar
        }
    }

    setStickyNav() {
        this.setState({navbarClass: classes.sticky});
        console.log("sticky nav active");
    }

    removeStickyNav() {
        this.setState({navbarClass: classes.Navbar});
        console.log("sticky nav inactive");
    }

    render() {

        return(
            <Aux>
                <Navbar className={classes.Navbar} navListStyle={classes.navItems} navItemStyle={classes.navItem} links={this.state.links}></Navbar>
                <Header></Header>

                    <section id="section-about">
                        <div className={classes.aboutBox}>
                            About
                        </div>
                    </section>
                    <Waypoint 
                    onEnter={this.setStickyNav}
                    onLeave={this.removeStickyNav}
                    topOffset={'90%'}>
                    <div>
                    <section id="section-resume" >
                        Resume
                    </section>
                    <section id="section-projects">
                        Projects
                    </section>
                    <section id="section-contact">
                        Contact
                    </section>
                    </div>
                </Waypoint>
            </Aux>
        );
    }
}

export default Profile;
